pragma solidity ^0.7.1;
//SPDX-License-Identifier: UNLICENSED

interface ITrustAnchorManager {
    function isTrustAnchorVerified(address _trustAnchorAddress) external view returns (bool result);
    function hasTrustAnchorBeenVerified(address _trustAnchorAddress) external view returns (bool result);

    function getTrustAnchorIndex(address _trustAnchorAddress) external view returns (uint32 result);

    function getTrustAnchorAddress(uint32 _trustAnchorIndex) external view returns (address result);

    function getTrustAnchorJurisdiction(address _trustAnchorAddress) external returns (uint16 result);

    function isPrimeRevocationManager(address _primeRevocationManagerAddress) external returns (bool result);

    function getGenericTrustAnchorExtraDataAddress() external view returns (address result);
    function getUniqueTrustAnchorExtraDataAddress(address _trustAnchorAddress) external view returns (address result);
}
